import numpy as np
import pandas as pd
import seaborn as sns
sns.set(style='ticks', color_codes=True)
import matplotlib.pyplot as plt
from seaborn import distplot

"""## Read data

The next step will be to read the files, which come in Excel format, containing the information on projects, participants and countries.
"""

projects = pd.read_excel('projects.xlsx')
participants = pd.read_excel('participants.xlsx')
countries = pd.read_excel('countries.xlsx')

"""## Data analysis

### Data visualisation

#### See different columns in each dataframe and its datatype
"""

projects.dtypes

"""We see the startDate column is in object format, so we change it to the correct one, which is datetime:"""

projects['startDate'] = pd.to_datetime(projects['startDate'])
projects.dtypes

participants.dtypes

countries.dtypes

"""The rest of the data types are in their corresponding format. Hence, no more changes are required.

#### See if there are any null values that need to be replaced
"""

projects.info() # No null values

participants.info() # Null values in organisation URL

countries.info() # No null values

"""## Plot data

Now we will plot the data. We want to see the Yearly EC contribution, first without aggregating by regions, seeing only the overall result of all countries per year.
"""

plt.figure(figsize=(15,10))
ax1=sns.barplot(x=projects.year,y=projects.ecMaxContribution, palette="mako")
plt.xticks(rotation=0)
plt.title("Yearly EC contribution (total) ()", fontsize=20, color="blue")
plt.xlabel("Year")
plt.ylabel("Amount")

"""Now we will perform several operations to create a new dataframe with only the data from the country the user requires to plot:"""

columns = ['projectID', 'year']  # First get the ID of each project with the year, so the EC contribution will be correctly assigned
df1 = projects[columns].copy()
col = ['projectID', 'ecContribution', 'country'] # We extract the contribution per project, and the country it belongs to
df2 = participants[col].copy()
df_plot = df1.merge(df2, on='projectID', how='inner') # We merge the two previous datasets to obtain all the information about each project (year, ecContribution and country)
df_plot

c = input('Choose a country introducing its 2 letter code: ') # Ask the user to input a country
while c not in participants['country'].tolist():
    c = input('Choose a valid country: ')

# Create new dataframe with data only from the selected country
new_d = df_plot[df_plot['country'] == c]
print(new_d)

"""Now, the bar plot will display the total annual received grants (ecContribution) from all the partners for the desired country:"""

# Plot the data for such country, using the new dataframe (new_d)
plt.figure(figsize=(15,10))
ax1=sns.barplot(x=new_d.year,y=new_d.ecContribution, palette="mako")
plt.xticks(rotation=0)
plt.title("Yearly EC contribution in " +c, fontsize=20, color="blue")
plt.xlabel("Country")
plt.ylabel("EC contribution")

"""We store this operations in the function annual_grants(), which will return this graph for whichever country the user selects."""

def annual_grants(c):
  new_d = df_plot[df_plot['country'] == c]
  #print(new_d)
  plt.figure(figsize=(15,10))
  ax1=sns.barplot(x=new_d.year,y=new_d.ecContribution, palette="mako")
  plt.xticks(rotation=0)
  plt.title("Yearly EC contribution in "+c, fontsize=20, color="blue")
  plt.xlabel("Country")
  plt.ylabel("EC contribution")

c = input('Choose a country introducing its 2 letter code: ')
while c not in participants['country'].tolist():
    c = input('Choose a valid country: ')

annual_grants(c)

