"""#Dataset

Finally, the code merges the 'projects' and 'participants' dataframes for getting the total amount of received grants and it filters the merged data by a selected country.
Then it specifies the aggregation functions to be applied to each column to make sense of them.
It renames the columns for clarity, shows the result sorted in descending order of contributions, and saves it to an Excel file named 'partners_dataset.xlsx'.
"""

merged_d = pd.merge(projects, participants, left_index=True, right_index=True)

selected_country = c
merged_d = merged_d[merged_d['country'] == selected_country]

grouped_d = merged_d.groupby('shortName').agg({
    'name': 'first',
    'activityType': 'first',
    'organizationURL': 'first',
    'ecContribution': 'sum',
    'acronym': 'count',
    'role': lambda x: sum(x == 'coordinator')
}).reset_index()

grouped_d.rename(columns={'acronym': 'count_project', 'ecContribution': 'sum_ecContribution'}, inplace=True)
result_d = grouped_d[['shortName', 'name', 'activityType', 'organizationURL', 'count_project', 'sum_ecContribution', 'role']]
result_d.rename(columns={'role': 'count_coordinator'}, inplace=True)

from IPython.display import display
result_d_sorted = result_d.sort_values(by='sum_ecContribution', ascending=False)
display(result_d_sorted)

result_d_sorted.to_excel('partners_dataset.xlsx', index=False)

